async function setUserNotify() {

  for (let index = 0; index < table.length; index++) {
    const res = await fetch(process.env.awsApiGatewayHttpApiEndPoint + "/setUserNotify", {
      method: "POST",
      body: JSON.stringify({
        type: table[index].type,
        index: String(table[index].index),
        preProgress: table[index].preProgress,
        nextProgress: table[index].nextProgress,
        preState: table[index].preState,
        nextState: table[index].nextState,
        notify: table[index].notify
      })
    });
    const item = await res.json();
    console.log(index, item);
    await sleep(100);
  }

}

